import React, {useState, useEffect, useRef } from "react";
import PropTypes from "prop-types";
import ReactPlayer from 'react-player'
// import './YoutubeParallax.css';





function YoutubeParallax  ({embedId}){ 
const [videoData, setVideoData] = useState('');

useEffect(() => {
  if (!window.YT) {
    var tag = document.createElement("script");
    tag.src = "https://www.youtube.com/iframe_api";
    var firstScriptTag = document.getElementsByTagName("script")[0];
    firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);
  } else {
  }

  window.onPlayerReady = (event) => {
    event.target.playVideo();
    // event.target.mute();
    console.log("starting video");
  };

  window.onPlayerStateChange = (event) => {
    if (event.data === 0) {
      console.log("done");
    }
  };

  window.onYouTubeIframeAPIReady = () => {
    const player = new window.YT.Player("YoutubeParallax", {
      width: 700,
      height: 700,
      playerVars: {
        autoplay: 1,
        controls: 0,
        playlist: "vmRIjeHlHIU",
        loop: 1
      },
      videoId: "vmRIjeHlHIU",
      events: {
        onReady: window.onPlayerReady,
        onStateChange: window.onPlayerStateChange
      }
    });
  };
});

  return(
  // <div className="" id="YoutubeParallax" style={{ border: '#008000 solid 3px' }}>
    
  // </div>
  <ReactPlayer url='https://www.youtube.com/watch?v=oklyzU9uS18' controls="false" playing="true" />
  )
};



export default YoutubeParallax;
